import React from 'react';
import logo from './logo.svg';
import './App.scss';

// img src={logo}

function App() {
    return (
        <div className="portfolioContainer">
            <div className="leftContainer">
            	<div className="infoContainer">
            		<p className="name">Mayer Seidman</p>
            		<p className="title">Designer <span className="circleDivider"></span> Developer</p>
            	</div>
            </div>
            <div className="rightContainer">
            	<div className="section">
            		<p>Hi, I’m <span>Mayer</span>.</p>
            		<p>No, I am not perfect. This quote means a lot to me because I think the details are essential. People can feel the sweat and effort that goes into everything we produce…</p>
            		<p>I spend my days as a designer and developer at WhooosReading.</p>
            		<p>I like creating things that help others and… link to github ….  </p>
            		<p>I enjoy writing about UI/UX topics. </p>
            		<p>I help others grow and share skills as a moderator in React FB Group </p>
            	</div>
            </div>
        </div>
    );
}
export default App;
